// *****************************************************************************
// This component displays the Company Mission Statement
// Goes to ==> App.js Component
// *****************************************************************************

import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";
import CallIcon from "@mui/icons-material/Call";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Divider from "@mui/material/Divider";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import { styled } from "@mui/material/styles";
import Typography from "@mui/material/Typography";
import Image from "mui-image";
import * as React from "react";
import AppointmentButton from "./AppointmentButton";
import FollowUs from "./FollowUs";
import ImageScroll from "./ImageScroll";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#c2c2c2" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export default function AboutUs() {
  return (
    <Box
      id="home"
      sx={{ display: "flex", flexDirection: "column", flexGrow: 1 }}
    >
      <br />
      <Divider>
        <Paper
          sx={{
            p: ".2rem",
            pr: "1.3rem",
            pl: "1.3rem",
            borderRadius: "65px",
            bgcolor: "primary.main",
            margin: "auto",
            display: "flex",
          }}
          elevation={3}
        >
          <Typography
            sx={{
              fontWeight: "400",
              display: { xs: "none", sm: "none", md: "flex" },
            }}
            variant="h2"
            color="primary.contrastText"
          >
            Auto Detailing
          </Typography>
          <Typography
            sx={{
              fontWeight: "400",
              display: { xs: "none", sm: "flex", md: "none", xl: "none" },
            }}
            variant="h4"
            color="primary.contrastText"
          >
            Auto Detailing
          </Typography>
          <Typography
            sx={{
              fontWeight: "400",
              display: { xs: "flex", sm: "none", md: "none" },
              fontSize: { xs: "2rem" },
            }}
            variant="h6"
            color="primary.contrastText"
          >
            Auto Detailing
          </Typography>
        </Paper>
      </Divider>
      <br />
      <Typography
        sx={{ display: "flex", justifyContent: "center" }}
        variant="h5"
        color="primary.main"
      >
        Amazing Quality Service
      </Typography>
      <Typography
        color="primary.main"
        sx={{
          fontSize: { xs: "1.rem", md: "1.3rem" },
          display: "flex",
          justifyContent: "center",
          textAlign: "center",
          pl: 2,
          pr: 2,
          pt: 1,
        }}
      >
        At Willis Deluxe Detailing we take pride in the quality of our work.
      </Typography>
      <Typography
        color="primary.main"
        sx={{
          fontSize: { xs: "1.rem", md: "1.3rem" },
          display: "flex",
          justifyContent: "center",
          textAlign: "center",
          pl: 2,
          pr: 2,
          pt: 1,
          pb: 1,
        }}
      >
        We guarantee you will be satisfied with our service.
      </Typography>
      <br />
      <Grid
        container
        spacing={2}
        direction="row"
        justifyContent="center"
        alignItems="center"
      >
        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={11} md={8} xl={4}>
          <Item sx={{ bgcolor: "primary.main", color: "white" }}>
            <Image src={require("../images/Willis_Deluxe_Detail_j.webp")} />
          </Item>
        </Grid>
        {/*//=========== GRID END =======================================> */}
      </Grid>
      <br />

      {/*//=========== GRID BOX START =================================> */}
      <Grid
        container
        spacing={2}
        direction="row"
        justifyContent="center"
        alignItems="center"
      >
        <Grid item xs={11} sm={10} md={10} lg={10} xl={7}>
          <Item
            elevation={4}
            sx={{ bgcolor: "primary.dark", color: "primary.contrastText" }}
          >
            <Paper sx={{ bgcolor: "primary.light" }}>
              <Divider variant="middle">
                <Typography
                  variant="h6"
                  sx={{
                    fontSize: { xs: "1rem", md: "1.5rem" },
                    fontWeight: 700,
                  }}
                >
                  Our Promise To You
                </Typography>
              </Divider>
            </Paper>
            <Grid
              sx={{
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-evenly",
                bgcolor: "primary.light",
              }}
            ></Grid>
            <Paper sx={{ bgcolor: "secondary.dark" }}>
              <Typography p={1}>
                When you walk into our shop to have your vehicle detailed, we
                are dedicated to providing you with friendly service, a
                welcoming atmosphere, and above all else, excellent results. If
                you are not satisfied, please let us know and we will do
                whatever we can to make things right!
              </Typography>
              <Button
                sx={{ mt: "5px" }}
                color="info"
                href="/schedule-appointment"
                startIcon={<CallIcon />}
                variant="contained"
              >
                Schedule An Appointment!
              </Button>
              <br />
              <br />
            </Paper>
          </Item>
        </Grid>

        {/*//=============== GRID END GOES TO BOTTOM  =====================> */}
      </Grid>
      <ImageScroll />
      <br />
      <FollowUs />
      <AppointmentButton />
    </Box>
  );
}
